CREATE DEFINER=`root`@`localhost` FUNCTION `CalculateTotalPaymentsByMethod`(method VARCHAR(30)) RETURNS decimal(10,2)
BEGIN
    DECLARE totalPayments DECIMAL(10,2);
    
    -- Calcular la suma total de pagos para el método especificado
    SELECT 
        COALESCE(SUM(PAYMENT), 0) INTO totalPayments
    FROM 
        PAYMENT_HISTORY
    WHERE 
        PAYMENT_METHOD = method;

    RETURN totalPayments;
end ;;
