CREATE DEFINER=`root`@`localhost` PROCEDURE `GetCoffeeTypeConsumptionSummary`(
    IN startDate DATE,
    IN endDate DATE
)
BEGIN
    SELECT 
        TYPE, 
        COUNT(*) AS Total_Consumptions
    FROM Consumptions
    WHERE DATE BETWEEN startDate AND endDate
    GROUP BY TYPE;
end ;;
